import React from 'react';
import './CustomForm.css'
import Header from '../Header/Header';
import { NavLink } from 'react-router-dom';
import { useForm } from 'react-hook-form';

const SignIn = () => {
    const { register, handleSubmit } = useForm();
    const onSubmit = data => console.log(data);
    return (
        <div>
            <Header />

            <div>
                <div>
                    <div className="titleForm">

                        <h1>Inicia sesion</h1>

                    </div>

                    <main className="formContainer">
                        <form onSubmit={handleSubmit(onSubmit)} action="" className="formRegister">

                            <input className="input" type="email" name="email" placeholder="Email" />

                            <input className="input" type="password" name="contraseña" placeholder="Contraseña" />

                            <input className="submit" type="submit" value="Iniciar" disabled></input>
                        </form>
                        <div className="signUp">
                            <p>¿No eres miembro? <NavLink to='/SignUp'>Crea tu usuario</NavLink></p>

                            <p className="errorText">si se produce un error al completar un formulario aparecera un mensaje aqui.</p>
                        </div>
                    </main>
                </div>
            </div>
        </div>
    );
}

export default SignIn;
